import React from "react";
import styles from './EducationCard.module.css'; // Correct import statement

interface EducationCardProps {
  title: string;
  description: string[];
}

const EducationCard: React.FC<EducationCardProps> = ({
  title,
  description,
}) => {
  return (
    <div className={styles["education-card"]}> {/* Use styles object */}
      <div className={styles["title"]}> {/* Use styles object */}
        <h6>{title}</h6>
      </div>
      <div className={styles["description"]}> {/* Use styles object */}
        <p>
          {description.map((text, index) => (
            <React.Fragment key={index}>
              <span>{text}</span>
              <br />
            </React.Fragment>
          ))}
        </p>
      </div>
    </div>
  );
};

export default EducationCard;
